import React from "react";

function Navbar() {
  return (
    <nav className="flex justify-between items-center py-4 mb-8 border-b">
      <div className="text-xl font-bold">Benny</div>
      <ul className="flex space-x-6">
        <li><a href="#projects" className="hover:text-green-500">Projects</a></li>
        <li><a href="#skills" className="hover:text-green-500">Skills</a></li>
        <li><a href="#contact" className="hover:text-green-500">Contact</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
